import React from 'react';
import work from "./work.css";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

function Work() {

  let settings={
        dots:true,
        infinite:true,
        speed:500,
        slideToShow:3,
        slidesToScroll:1,
        autoplay:true,
        cssEase:"linear"
    }

  return (
   
    <div className="Container2"  >
        
          <h1 className="heading">WHAT I'VE DONE ?</h1>
          
          
          <Slider className='slider' {...settings}>
          <div className="card_wh">
              <div className="card">
                    <div className="Wrap">
                <img src="/images/disney.jpg" alt="project" />
          </div>
              </div>
          </div>
        
           <div className="Wrap">
                <img  src="/images/netflix.jpg" alt="project" />
          </div>
           <div className="Wrap">
         <img src="/images/TA1.png" alt="project" />
          </div>
          </Slider>
           
           
        </div>
       
  )
}




export default Work;
